    false,nt"url": null,nt"notes": "This narrative report for Flint Hills NWR
    outlines Refuge accomplishments during the 1987 calendar year. The report begins
    with an introduction to the Refuge and information about weather conditions. Planning
    is covered; topics include the management plan and research and investigations.
    The administration section discusses personnel, youth programs, funding, safety,
    and technical assistance. Habitat management is covered; croplands, grasslands,
    wetlands, forests, fire management, pest control, and water rights are discussed.
    The wildlife section of the report discusses endangered and threatened species,
    waterfowl, migratory birds, game mammals, fisheries resources, scientific collections,
    and marking and banding. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreational uses, and law enforcement.
    The equipment and facilities section discusses new construction, major maintenance,
    equipment utilization and replacement, communication systems and energy conservation.
    Cooperative programs, items of interest, photographs, and brochures are attached.",nt"license_title":
